import React from "react";
import styles from "./SectionsContainer.module.css";
import Icons from '../../assets/icons/icons';
import CustomButton from '../../utils/CustomButton'
export default function Section3(){
    const boxes = ['Wyślij wstępną listę potrzebnych materiałów','Wyślij wstępną listę potrzebnych materiałów','Wyślij wstępną listę potrzebnych materiałów','Wyślij wstępną listę potrzebnych materiałów']
    const listItems = boxes.map((box, index) =>
    <ListItem value={box} number={index} />
  );
    return(
        <div class="container-fluid " style={{position:'relative', padding:'100px 0px', backgroundColor:'#D4D4D4',marginTop:'100px'}}>
            <div class="row  m-auto px-lg-5 row-container d-flex flex-md-row flex-column" >
            {listItems}
            </div>
<div class="row">
  <div class="col-2 m-auto w-100 mt-5"><CustomButton title={'Więcej o ofercie'}/></div></div>
        </div>
    )
}
function ListItem(props) {
 
    return (
      <>
      <Icons icon="square" width='20' height='20' />
      <p>{props.number}</p>
    <p>{props.value}</p>
     </>
    );
  }
